import { useState } from "react"
import { setCachedTicker, filterCachedTickers, setToRemove } from "../redux/stockSlice"
import { useDispatch, useSelector } from "react-redux"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


export function Ticker ({
  id,
  ticker,
  exchange,
  price,
  change,
  change_percent
}) 
{

  const dispatch = useDispatch()

  const { cachedTickers } = useSelector(state => state.stocks)

  const filteredTicker = cachedTickers.filter(tickr => tickr.id === id)

  const [clicked, setClicked] = useState(false)
  const [className, setClassName] = useState('row')

  const handleCache = () => {
    const cachedTicker = {
      id,
      ticker,
      exchange,
      price,
      change,
      change_percent
    }

    setClicked(!clicked)

    if (!cachedTickers.map(tick => tick.id).includes(id)) {
      dispatch(setCachedTicker(cachedTicker))  
    }

    if (clicked === true) {
      dispatch(filterCachedTickers(cachedTicker))
    }

    console.log(cachedTickers)
  }

  const handleRemove = () => {
    setClassName('d-none')
    dispatch(setToRemove(ticker))
  }



  if (!clicked) {
    return (
      <div className='row'>
        <p className="col my-auto d-flex justify-content-between"><span className="title">Name: </span><span>{ticker}</span></p>
        <p className="col my-auto d-flex justify-content-between"><span className="title">Stock: </span><span>{exchange}</span></p>
        <p className="col my-auto d-flex justify-content-between"><span className="title">Price: </span><span className="dyn">{price}$</span></p>
        <p className="col my-auto d-flex justify-content-between"><span className="title">Change: </span><span className="dyn">{change}$</span></p>
        <p className="col my-auto d-flex justify-content-between"><span className="title">In percents: </span><span className="dyn">{change_percent}%</span></p>
        <div className="d-flex col">
          <button className="btn btn-danger col my-auto" onClick={() => handleRemove()}>Delete</button>
          <button className="btn btn-warning col my-auto" onClick={() => handleCache()}>Stop</button>
        </div>     
      </div> 
    )
  } else {
    return (
      <>
        {
          filteredTicker.map((tick, i) => 
            <div key={i} className='row'>
              <p className="col my-auto d-flex justify-content-between"><span className="title">Name: </span><span>{tick.ticker}</span></p>
              <p className="col my-auto d-flex justify-content-between"><span className="title">Stock: </span><span>{tick.exchange}</span></p>
              <p className="col my-auto d-flex justify-content-between"><span className="title">Price: </span><FontAwesomeIcon icon="fa-solid fa-arrow-trend-up" /><span className="dyn">{tick.price}$</span></p>
              <p className="col my-auto d-flex justify-content-between"><span className="title">Change: </span><span className="dyn">{tick.change}$</span></p>
              <p className="col my-auto d-flex justify-content-between"><span className="title">In percents: </span><span className="dyn">{tick.change_percent}%</span></p>
              <div className="d-flex col">
                <button className="btn btn-danger col my-auto" onClick={() => handleRemove()}>Delete</button>
                <button className="btn btn-warning col my-auto" onClick={() => handleCache()}>Start</button>
              </div>     
            </div>
          )
        }  
      </>
      )

  }

}
